        <div class=""container py-lg-5"">
            <div class=""row about-main"">
                <div class=""col-lg-6 about-text-grid1 text-left"">
                    <div class=""title-desc"">
                        <h4><span></span>Get started</h4>
                        <h3 class=""main-title-w3pvt text-capitalize my-4"">
                            Tham Gia Với Chúng Tôi. Chúng Ta Sẽ Cùng Nhau
                            Tạo Nên Một Nền Giáo Dục Tốt Nhất!
                        </h3>
                    </div>

                </div>
                <div class=""col-lg-6 about-right mt-lg-0 mt-4"">
                    <p");
                BeginWriteAttribute("class", " class=\"", 28156, "\"", 28164, 0);
                EndWriteAttribute();
                WriteLiteral(@">
                        Từ những lớp học nho nhỏ được mở ra từ năm 2016,
                        đến nay Informing đã đồng hành cùng hàng nghìn học viên trong khắp cả nước chinh phục thành công
                        ước mơ trở thành một lập trình viên xuất sắc.
                        Với Informing, mỗi một cuộc gặp gỡ với học viên là một cái duyên, chưa biết tương lai thế nào
                        nhưng trước mắt là một sự trân trọng.
                        Chính vị vậy, sự trải nghiệm của học viên rất được chú trọng.
                    </p>
                    <p class=""mt-4"">
                        Trải nghiệm xuất sắc là điều mà Informing luôn hướng đến bằng những triết lý giáo
                        dục hiện đại và
                        phương pháp giảng dạy tích cực. Điều đó được thể hiện thông qua những trăn trở:
                        “Các bạn học có vui không? Có hiểu bài không? Có làm được việc không?”
                        Informing cũng như một điểm đến quen thuộc của h");
                WriteLiteral(@"ọc viên, nơi mà họ có thể vẫy vùng thoải mái
                        giữa kho tàng kiến thức lập trình
                        một cách tự do, say mê và cuồng nhiệt mà không hề chịu nhiều áp lực trường lớp, đơn giản vì nơi
                        đó là nhà.
                    </p>
                </div>
            </div>
        </div>
